import 'bootstrap/dist/css/bootstrap.min.css'
import '../Header.css'
import { Navbar } from 'reactstrap';


class Bar extends Component {

    constructor(props) {
        super(props);

        this.toggle = this.toggle.bind(this);
        this.state = {
            isOpen: false
        };
    }
    toggle() {
        this.setState({
            isOpen: !this.state.isOpen
